import React from "react";
import Avatar from '@mui/material/Avatar';
import logo from '../logo.svg';
import '../App.css';

import  avtar1 from "../images/avtar1.jpg";

export const UserList = (props) => {

  return (
    <div>

      <div className="container">
      <table>

        <tr>

          <td className="set">{props.imgavtar}<p className="setitem">{props.name}<br/>{props.email}</p></td>
          <td className="settitle2">{props.status}</td>
          <td className="settitle3">{props.Access}</td>
          <td>{props.action}</td>
        </tr>

      </table>
      </div>
    </div>
  );
};
export default UserList;
